import React, { useRef } from "react";
import { motion, useScroll, useTransform, useSpring } from "framer-motion";
import Header from "./Header";
import InteractiveLines from "./InteractiveLines";

const Pawmeet: React.FC = () => {
  const { scrollY } = useScroll();
  const x = useTransform(scrollY, [0, 400], [0, -200]);
  const xSpring = useSpring(x, { stiffness: 100, damping: 30 });

  return (
    <div className="relative min-h-screen bg-[#F4F1EC]">
      <Header />
      <section className="relative w-full min-h-[100vh] h-screen overflow-hidden">
        <InteractiveLines />
        <div className="absolute inset-0 flex flex-col items-center justify-center">
          <div className="text-center mb-8">
            <h2 className="text-2xl font-bold mb-2">PAWMEET</h2>
            <p className="text-gray-600">HELP PETS FINDING THEIR SOUL MATE</p>
          </div>
          <motion.div
            className="relative z-20"
            animate={{
              y: [0, -20, 0],
            }}
            transition={{
              duration: 4,
              repeat: Infinity,
              ease: "easeInOut",
            }}
          >
            <img src="/card1.png" alt="Card" className="w-80 h-auto shadow-xl rounded-2xl" />
          </motion.div>
        </div>
        <motion.h1
          className="relative z-10 text-[40vw] md:text-[35vw] lg:text-[30vw] font-serif font-bold text-right mt-[45vh] md:mt-[25vh] pr-[5vw] whitespace-nowrap opacity-10"
          style={{ x: xSpring }}
        >
          PAWMEET
        </motion.h1>
      </section>
      
      <section className="relative w-full min-h-screen bg-white py-20 px-8">
        <div className="max-w-4xl mx-auto">
          <h2 className="text-4xl font-bold mb-8">About</h2>
          <div className="prose prose-lg">
            <p className="mb-4">
              "PAWMEET" is a pet social networking app designed to help pet owners find
              compatible playmates for their pets and connect within a pet-friendly community.
            </p>
            <p className="mb-4">
              Users can help their pets match playmates, arrange playdates, access
              pet-related services.
            </p>
          </div>
          <div className="mt-16 grid grid-cols-1 md:grid-cols-2 gap-8">
            <div className="bg-[#F4F1EC] p-8 rounded-2xl">
              <h3 className="text-2xl font-bold mb-4">UI/UX Design</h3>
              <p>Modern and intuitive interface designed for pet owners</p>
            </div>
            <div className="bg-[#F4F1EC] p-8 rounded-2xl">
              <h3 className="text-2xl font-bold mb-4">Development</h3>
              <p>Front-end and Back-end Development with latest technologies</p>
            </div>
          </div>
        </div>
      </section>
    </div>
  );
};

export default Pawmeet;
